import React, { Component } from 'react';

class VotingGrid extends Component {

    state = {count: 0, name: "undefinded"}

    constructor(props) {
        super(props);
        this.state.count = props.count;
        this.state.name = props.name;
    }

    render() {
        return (<div className="voting-grid">
            <div className="counter">{this.count}</div>
            <div className="language-name">{this.name}</div>
            <button className="voting-button">Vote for it!</button>
        </div>);
    }
}

export default VotingGrid;
